sys_variable_value.value:
(function execute(inputs, outputs) {
// ... code ...
var domain = inputs.dsys_id;
var tbl = inputs.table_name;

var gr = new GlideRecord(tbl);
gr.addQuery('sys_domain',domain);
gr.query();
var count = gr.getRowCount();

outputs.rcount = count;

})(inputs, outputs);

